    def onClean(self):
        global added_dim
        for d in added_dim:
            try:
                FreeCAD.ActiveDocument.removeObject(d.Name)
            except:
                pass
        if FreeCAD.ActiveDocument is not None:
            FreeCAD.ActiveDocument.recompute()
            for ob in FreeCAD.ActiveDocument.Objects:
                FreeCADGui.Selection.removeSelection(ob)
        added_dim=[]
